<script>
		$(document).ready(function(){
			var fill;
			var pill;
			$('g').mouseover(function(){
				var state = $(this).attr('id');
				pill = $(this).attr('fill');
				$(this).attr('fill','#CC6600');
				var pos = $(this).offset();
				console.log(pos);
				loop_states(state,pos);
				//console.log(state);
			});

			$('g').mouseout(function(){

				
				$(this).attr('fill',pill);
				var check = $('#cities').css('display');
				/*if(check=='block') {
					$('#cities').toggle();
				}*/
				
			});

			$('path').mouseover(function(){
				var state = $(this).attr('id');
				fill = $(this).attr('fill');
				$(this).attr('fill','#CC6600');
				var pos = $(this).offset();
				loop_states(state,pos);
				//console.log(state);
			});

			$('#cities').on('mouseover',function(){
				$(this).show();
			});
			
			$('path').mouseout(function(){

				
				$(this).attr('fill',fill);
				var check = $('#cities').css('display');
				if(check=='block') {
					$('#cities').toggle();
				}
				
			});

			function loop_states(state,pos) {
				//console.log(state);
				var section = $('.state-list');
				var group = $(section).children().toArray();
				//var result = $('.state-list').find("[data-state='" + state + "']");
				$( ".state-list div" ).each(function( index ) {
					var result = $(this).attr('data-state');
					if(result == state) {
						//console.log(pos);
						var content = $(this).html();
						//console.log(content);
						$('#cities').html(content);
						$('#cities').css('display','block');
						$('#cities').css({top: pos.top, left: pos.left, position:'absolute'});
						/*if(state=="newYork") {
							$('#cities').css({top: 500, left: 900, position:'absolute'});
						} else {
							$('#cities').css({top: pos.top, left: pos.left, position:'absolute'});
						}*/
					} 
				});

			}
		});
	</script>

